function CreateNeutralBuildings(building_type, building_number, min_x, max_x, min_y, max_y, symmetric)
	if (LoadedGame == false) then -- save games using maps with this function were not loading without this
		local Count = 0
		Count = building_number
		local WhileCount = 0
		local building_player = PlayerNumNeutral
		while (Count > 0 and WhileCount < building_number * 100) do
			local building_spawn_point = FindAppropriateNeutralBuildingSpawnPoint(building_type, min_x, max_x, min_y, max_y, symmetric)
			if (building_type == "unit-mercenary-camp" and building_player == PlayerNumNeutral) then
				local potential_civilizations = GetTerrainCivilizations(GetTileTerrainName(building_spawn_point[1], building_spawn_point[2]))
				local all_factions = GetFactions()
				local potential_factions = {}
				for i=1, table.getn(all_factions) do
					if (GetArrayIncludes(potential_civilizations, GetFactionData(all_factions[i], "Civilization")) and GetFactionData(all_factions[i], "Type") == "mercenary-company") then
						table.insert(potential_factions, all_factions[i])
					end
				end

				if (table.getn(potential_factions) > 0) then
					building_player = CreatePlayerForFaction(potential_factions[SyncRand(table.getn(potential_factions)) + 1])
					if (building_player == -1) then
						return;
					end
				end
			end
			unit = CreateUnit(building_type, building_player, {building_spawn_point[1], building_spawn_point[2]})
			Count = Count - 1
			if (symmetric) then
				local mirrored_tile_x = building_spawn_point[1] + 1 - 128
				if (mirrored_tile_x < 0) then
					mirrored_tile_x = mirrored_tile_x * -1
				end

				local mirrored_tile_y = building_spawn_point[2] + 1 - 128
				if (mirrored_tile_y < 0) then
					mirrored_tile_y = mirrored_tile_y * -1
				end

				unit = CreateUnit(building_type, building_player, {mirrored_tile_x - (GetUnitTypeData(building_type, "TileWidth") - 1), building_spawn_point[2]})
				Count = Count - 1

				unit = CreateUnit(building_type, building_player, {building_spawn_point[1], mirrored_tile_y - (GetUnitTypeData(building_type, "TileHeight") - 1)})
				Count = Count - 1

				unit = CreateUnit(building_type, building_player, {mirrored_tile_x - (GetUnitTypeData(building_type, "TileWidth") - 1), mirrored_tile_y - (GetUnitTypeData(building_type, "TileHeight") - 1)})
				Count = Count - 1
			end
			WhileCount = WhileCount + 1
		end
	end
end

function CreateStartingLocationResourcePiles(loc_player, pile_type, pile_quantity)
	if (LoadedGame == false) then
		local min_x = math.max(CPlayer:GetPlayer(loc_player).StartPos.x - 8, 0)
		local max_x = math.min(CPlayer:GetPlayer(loc_player).StartPos.x + 8, CMap.Map.Info.MapWidth - 1)
		local min_y = math.max(CPlayer:GetPlayer(loc_player).StartPos.y - 8, 0)
		local max_y = math.min(CPlayer:GetPlayer(loc_player).StartPos.y + 8, CMap.Map.Info.MapHeight - 1)
				
		local RandomX = 0
		local RandomY = 0
		local location_found = false
		local WhileCount = 0
		while (location_found == false and WhileCount < 1000) do
			RandomX = SyncRand(max_x - min_x + 1) + min_x
			RandomY = SyncRand(max_y - min_y + 1) + min_y
					
			local in_appropriate_land = true
			for x_offset=0, (GetUnitTypeData(pile_type, "TileWidth") - 1) do
				for y_offset=0, (GetUnitTypeData(pile_type, "TileHeight") - 1) do
					if (GetTileTerrainHasFlag(RandomX + x_offset, RandomY + y_offset, "land") == false or GetTileTerrainHasFlag(RandomX + x_offset, RandomY + y_offset, "unpassable")) then
						in_appropriate_land = false
						break
					end
				end
			end
			if (in_appropriate_land) then
				local unit_quantity = GetNumUnitsAt(-1, "any", {RandomX - 2, RandomY - 2}, {RandomX + (GetUnitTypeData(pile_type, "TileWidth") - 1) + 2, RandomY + (GetUnitTypeData(pile_type, "TileHeight") - 1) + 2})

				if (unit_quantity < 1) then
					location_found = true
				end
			end
			WhileCount = WhileCount + 1
		end
				
		if (location_found) then
			for i=1,pile_quantity do
				unit = CreateUnit(pile_type, PlayerNumNeutral, {RandomX, RandomY})
			end
		end
	end
end

function CreateCritters(arg)
	if (arg == nil) then
		arg = {}
	end
	if (LoadedGame == false) then
		local critter_number = (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 256
		local RandomNumber = 0
		local RandomX = 0
		local RandomY = 0
		local Count = critter_number
		local WhileCount = 0
		
		local unit_type_list = GetUnitTypes()
		local critter_types = {}
		local critter_terrains = {}
		for i=1,table.getn(unit_type_list) do
			local species = GetUnitTypeData(unit_type_list[i], "Species")
			if (
				species ~= ""
				and GetUnitTypeData(unit_type_list[i], "Fauna")
				and (MapWorld == "" or MapWorld == "Random" or MapWorld == GetWorldData(GetSpeciesData(species, "Homeworld"), "Name"))
				and (GetUnitTypeData(unit_type_list[i], "Predator") == false or not arg.NoPredators)
				and (GetUnitTypeData(unit_type_list[i], "Type") ~= "fly" or GetUnitTypeData(unit_type_list[i], "Predator") == false or not arg.NoFlyingCreeps)
				and (GetUnitTypeData(unit_type_list[i], "Level") < 3 or GetUnitTypeData(unit_type_list[i], "Predator") == false or not arg.NoMightyCreeps)
				and (GetSpeciesData(species, "Prehistoric") == false or (GetCurrentQuest() == "" and GetCurrentCampaign() == ""))
			) then
				local has_terrain = false
				local species_terrains = GetSpeciesData(species, "Terrains")
				for j=1,table.getn(species_terrains) do
					if (GetTileTerrainCount(species_terrains[j])) then
						has_terrain = true
						break
					end
				end
				
				if (has_terrain) then
					local critter_unit_type = unit_type_list[i]
					-- if there is a species this one can evolve from, use it instead, but only if we aren't playing a quest or in the grand strategy mode; in custom maps species can evolve to descendants
					table.insert(critter_types, critter_unit_type)
					table.insert(critter_terrains, species_terrains)
				end
			end
		end

		if (table.getn(critter_types) == 0) then
			return;
		end
		
		-- create critters
		while (Count > 0 and WhileCount < critter_number * 1000) do
			local chosen_critter = SyncRand(table.getn(critter_types)) + 1
			local critter_unit_type = critter_types[chosen_critter]
			if (critter_unit_type == "") then
				Count = 0
				break
			end
			RandomX = SyncRand(CMap.Map.Info.MapWidth)
			RandomY = SyncRand(CMap.Map.Info.MapHeight)
			
			local correct_tile = true
			for sub_x = -(GetUnitTypeData(critter_unit_type, "TileWidth")), GetUnitTypeData(critter_unit_type, "TileWidth") do
				for sub_y = -(GetUnitTypeData(critter_unit_type, "TileHeight")), GetUnitTypeData(critter_unit_type, "TileHeight") do
					if (CMap.Map.Info:IsPointOnMap(RandomX + sub_x, RandomY + sub_y, 0)) then
						if not (
							(
								(
									GetUnitTypeData(critter_unit_type, "Type") == "land" and GetTileTerrainHasFlag(RandomX + sub_x, RandomY + sub_y, "land") and GetTileTerrainHasFlag(RandomX + sub_x, RandomY + sub_y, "unpassable") == false
								)
								or (GetUnitTypeData(critter_unit_type, "Type") == "naval" and GetTileTerrainHasFlag(RandomX + sub_x, RandomY + sub_y, "water") and GetTileTerrainHasFlag(RandomX + sub_x, RandomY + sub_y, "unpassable") == false)
								or (GetUnitTypeData(critter_unit_type, "Type") == "fly-low" and GetTileTerrainHasFlag(RandomX + sub_x, RandomY + sub_y, "unpassable") == false)
								or (GetUnitTypeData(critter_unit_type, "Type") == "fly" and GetTileTerrainHasFlag(RandomX + sub_x, RandomY + sub_y, "air-unpassable") == false)
							)
							and (GetArrayIncludes(critter_terrains[chosen_critter], GetTileTerrainName(RandomX + sub_x, RandomY + sub_y)) or GetArrayIncludes(GetSpeciesData(GetUnitTypeData(critter_unit_type, "Species"), "Terrains"), GetTileTerrainName(RandomX + sub_x, RandomY + sub_y)))
						) then
							correct_tile = false
							break
						end
					end
				end
			end
			if (correct_tile) then
				local unit_quantity = 0
				for i=0,(PlayerMax - 2) do
					unit_quantity = unit_quantity + GetNumUnitsAt(i, "any", {RandomX - 16, RandomY - 16}, {RandomX + 16, RandomY + 16})
				end

				if (unit_quantity < 1) then
					unit = CreateUnit(critter_unit_type, PlayerNumNeutral, {RandomX, RandomY})
					Count = Count - GetUnitTypeData(critter_unit_type, "Demand")
				end
			end
			WhileCount = WhileCount + 1
		end
	end
end

function GetRandomCritterUnitType()
	local critter_unit_type
	local RandomNumber = 0
	if (GetCurrentTileset() == "conifer-forest-summer" or GetCurrentTileset() == "conifer-forest-autumn") then
		RandomNumber = SyncRand(5)
		if (RandomNumber == 0) then
			critter_unit_type = "unit-rat"
		elseif (RandomNumber == 1) then
			critter_unit_type = "unit-bird"
		elseif (RandomNumber == 2) then
			critter_unit_type = "unit-crow"
		elseif (RandomNumber == 3) then
			critter_unit_type = "unit-frog"
		elseif (RandomNumber == 4) then
			critter_unit_type = "unit-horse"
		end
	elseif (GetCurrentTileset() == "dungeon") then
		RandomNumber = SyncRand(3)
		if (RandomNumber == 0) then
			critter_unit_type = "unit-slime"
		elseif (RandomNumber == 1) then
			critter_unit_type = "unit-bat"
		elseif (RandomNumber == 2) then
			critter_unit_type = "unit-rat"
		end
	elseif (GetCurrentTileset() == "swamp") then
		RandomNumber = SyncRand(3)
		if (RandomNumber == 0) then
			critter_unit_type = "unit-slime"
		elseif (RandomNumber == 1) then
			critter_unit_type = "unit-yale"
		elseif (RandomNumber == 2) then
			critter_unit_type = "unit-snigill"
		end
	elseif (GetCurrentTileset() == "cave") then
		RandomNumber = SyncRand(4)
		if (RandomNumber == 0) then
			critter_unit_type = "unit-slime"
		elseif (RandomNumber == 1) then
			critter_unit_type = "unit-snigill"
		elseif (RandomNumber == 2) then
			critter_unit_type = "unit-blood-bat"
		elseif (RandomNumber == 3) then
			critter_unit_type = "unit-dread-bat"
		end
	else
		critter_unit_type = ""
	end
	return critter_unit_type
end

function CreateCreeps(player, creep_type, creep_number, min_x, min_y, max_x, max_y)
	if (LoadedGame == false) then
		min_x = math.max(min_x, 0)
		max_x = math.min(max_x, CMap.Map.Info.MapWidth - 1)
		min_y = math.max(min_y, 0)
		max_y = math.min(max_y, CMap.Map.Info.MapHeight - 1)
	
		local RandomX = 0
		local RandomY = 0
		local Count = 0
		local WhileCount = 0
		Count = creep_number
		while (Count > 0 and WhileCount < creep_number * 1000) do
			RandomX = SyncRand(max_x - min_x + 1) + min_x
			RandomY = SyncRand(max_y - min_y + 1) + min_y
			if (GetTileTerrainHasFlag(RandomX, RandomY, "land") and GetTileTerrainHasFlag(RandomX, RandomY, "unpassable") == false) then
				local unit_quantity = 0
				for i=0,(PlayerMax - 2) do
					if (i ~= player) then
						unit_quantity = unit_quantity + GetNumUnitsAt(i, "any", {RandomX - 16, RandomY - 16}, {RandomX + 16, RandomY + 16})
					end
				end

				if (unit_quantity < 1) then -- creeps shouldn't start near a settlement, or the player will likely be destroyed
					unit = CreateUnit(creep_type, player, {RandomX, RandomY})
					SetUnitVariable(unit, "Active", false)
					Count = Count - 1
				end
			end
			WhileCount = WhileCount + 1
		end
	end
end

function CreateDecorationObjects(unit_type, unit_number, base_tile, mixed_tile, min_x, max_x, min_y, max_y)
	if (LoadedGame == false) then
		local RandomX = 0
		local RandomY = 0
		local Count = unit_number
		local WhileCount = 0
		while (Count > 0 and WhileCount < unit_number * 100) do
			RandomX = SyncRand(max_x - min_x - (GetUnitTypeData(unit_type, "TileWidth") - 1) + 1) + min_x
			RandomY = SyncRand(max_y - min_y - (GetUnitTypeData(unit_type, "TileHeight") - 1) + 1) + min_y
			if (GetTileTerrainName(RandomX, RandomY) == base_tile) then
				local unit_quantity = GetNumUnitsAt(-1, "any", {RandomX, RandomY}, {RandomX + (GetUnitTypeData(unit_type, "TileWidth") - 1), RandomY + (GetUnitTypeData(unit_type, "TileHeight") - 1)})

				if (unit_quantity < 1) then -- tile should be empty
					unit = CreateUnit(unit_type, PlayerNumNeutral, {RandomX, RandomY})
					Count = Count - 1
				end
			end
			WhileCount = WhileCount + 1
		end
	end
end

function CreateRoamingFog(fog_number)
	if (LoadedGame == false) then
		local RandomNumber = 0
		local RandomX = 0
		local RandomY = 0
		local Count = fog_number
		local WhileCount = 0
		-- create critters
		while (Count > 0 and WhileCount < fog_number * 100) do
			local fog_type
			RandomNumber = SyncRand(2)
			if (RandomNumber == 0) then
				fog_type = "unit-roaming-fog"
			else
				fog_type = "unit-roaming-fog-small"
			end
			RandomX = SyncRand(CMap.Map.Info.MapWidth - GetUnitTypeData(fog_type, "TileWidth"))
			RandomY = SyncRand(CMap.Map.Info.MapHeight - GetUnitTypeData(fog_type, "TileHeight"))
			if (GetTileTerrainHasFlag(RandomX, RandomY, "air-unpassable") == false and GetUnitTypeData(fog_type, "TileWidth") < CMap.Map.Info.MapWidth - RandomX - 1 and GetUnitTypeData(fog_type, "TileHeight") < CMap.Map.Info.MapHeight - RandomY - 1) then
				unit = CreateUnit(fog_type, PlayerNumNeutral, {RandomX, RandomY})
				Count = Count - 1
			end
			WhileCount = WhileCount + 1
		end
	end
end

function CreateDecorations()
	if (LoadedGame == false) then
		local RandomX = 0
		local RandomY = 0
		local Count = 0
		local RandomNumber = 0
		local WhileCount = 0

		local decoration_count = GetNumUnitsAt(-1, "unit-mushroom", {0, 0}, {512, 512}) + GetNumUnitsAt(-1, "unit-flowers", {0, 0}, {512, 512}) + GetNumUnitsAt(-1, "unit-twigs", {0, 0}, {512, 512}) + GetNumUnitsAt(-1, "unit-bones", {0, 0}, {512, 512}) + GetNumUnitsAt(-1, "unit-large-flower", {0, 0}, {512, 512}) + GetNumUnitsAt(-1, "unit-fern", {0, 0}, {512, 512}) + GetNumUnitsAt(-1, "unit-log", {0, 0}, {512, 512}) + GetNumUnitsAt(-1, "unit-wyrm-skeleton", {0, 0}, {512, 512}) + GetNumUnitsAt(-1, "unit-small-rocks", {0, 0}, {512, 512}) + GetNumUnitsAt(-1, "unit-stalagmites", {0, 0}, {512, 512}) -- mushroom patch not listed here since it occurs in many maps through normal generation
		Count = (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 128
		if (decoration_count == 0 and GetTileTerrainFlagCount("land") > Count) then
			while (Count > 0 and WhileCount < ((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 128) * 100) do
				RandomX = SyncRand(CMap.Map.Info.MapWidth)
				RandomY = SyncRand(CMap.Map.Info.MapHeight)
				if (GetTileTerrainHasFlag(RandomX, RandomY, "land") and GetTileTerrainHasFlag(RandomX, RandomY, "unpassable") == false and GetTileTerrainHasFlag(RandomX, RandomY, "water") == false and GetTileTerrainHasFlag(RandomX, RandomY, "coast") == false and GetNumUnitsAt(PlayerNumNeutral, "any", {RandomX, RandomY}, {RandomX, RandomY}) < 1) then
					RandomNumber = SyncRand(1000)
					if (RandomNumber < 200) then
						unit = CreateUnit("unit-mushroom-patch", PlayerNumNeutral, {RandomX, RandomY})
						Count = Count - 1
					elseif (RandomNumber >= 200 and RandomNumber < 300) then
						if (GetTileTerrainName(RandomX, RandomY) ~= "cave-floor" and GetTileTerrainName(RandomX, RandomY) ~= "rockbound-cave-floor" and GetTileTerrainName(RandomX, RandomY) ~= "floor" and GetTileTerrainName(RandomX, RandomY) ~= "rug" and GetTileTerrainName(RandomX, RandomY) ~= "gold-pile") then
							unit = CreateUnit("unit-flowers", PlayerNumNeutral, {RandomX, RandomY})
							Count = Count - 1
						end
					elseif (RandomNumber >= 300 and RandomNumber < 400) then
						if (GetTileTerrainName(RandomX, RandomY) ~= "cave-floor" and GetTileTerrainName(RandomX, RandomY) ~= "rockbound-cave-floor" and GetTileTerrainName(RandomX, RandomY) ~= "floor" and GetTileTerrainName(RandomX, RandomY) ~= "rug" and GetTileTerrainName(RandomX, RandomY) ~= "gold-pile") then
							unit = CreateUnit("unit-large-flower", PlayerNumNeutral, {RandomX, RandomY})
							Count = Count - 1
						end
					elseif (RandomNumber >= 400 and RandomNumber < 600) then
						if ((GetTileTerrainName(RandomX, RandomY) == "cave-floor" or GetTileTerrainName(RandomX, RandomY) == "rockbound-cave-floor") and SyncRand(2) == 0) then
							unit = CreateUnit("unit-stalagmites", PlayerNumNeutral, {RandomX, RandomY})
							Count = Count - 1
						else
							unit = CreateUnit("unit-small-rocks", PlayerNumNeutral, {RandomX, RandomY})
							Count = Count - 1
						end
					elseif (RandomNumber >= 600 and RandomNumber < 800) then
						if (GetTileTerrainName(RandomX, RandomY) ~= "cave-floor" and GetTileTerrainName(RandomX, RandomY) ~= "rockbound-cave-floor" and GetTileTerrainName(RandomX, RandomY) ~= "floor" and GetTileTerrainName(RandomX, RandomY) ~= "rug" and GetTileTerrainName(RandomX, RandomY) ~= "gold-pile") then
							unit = CreateUnit("unit-twigs", PlayerNumNeutral, {RandomX, RandomY})
							Count = Count - 1
						elseif (GetTileTerrainName(RandomX, RandomY) == "floor") then
							unit = CreateUnit("unit-floor-decoration", PlayerNumNeutral, {RandomX, RandomY})
							Count = Count - 1
						end
					elseif (RandomNumber >= 800 and RandomNumber < 875) then
						if (GetTileTerrainName(RandomX, RandomY) ~= "cave-floor" and GetTileTerrainName(RandomX, RandomY) ~= "rockbound-cave-floor" and GetTileTerrainName(RandomX, RandomY) ~= "floor" and GetTileTerrainName(RandomX, RandomY) ~= "rug" and GetTileTerrainName(RandomX, RandomY) ~= "gold-pile") then
							unit = CreateUnit("unit-fern", PlayerNumNeutral, {RandomX, RandomY})
							Count = Count - 1
						end
					elseif (RandomNumber >= 875 and RandomNumber < 900) then
						if (GetTileTerrainName(RandomX, RandomY) ~= "cave-floor" and GetTileTerrainName(RandomX, RandomY) ~= "rockbound-cave-floor" and GetTileTerrainName(RandomX, RandomY) ~= "floor" and GetTileTerrainName(RandomX, RandomY) ~= "rug" and GetTileTerrainName(RandomX, RandomY) ~= "gold-pile") then
							unit = CreateUnit("unit-log", PlayerNumNeutral, {RandomX, RandomY})
							Count = Count - 1
						end
					elseif (RandomNumber >= 900 and RandomNumber < 999) then
						unit = CreateUnit("unit-bones", PlayerNumNeutral, {RandomX, RandomY})
						Count = Count - 1
					elseif (RandomNumber >= 999) then
						if (GetTileTerrainName(RandomX, RandomY) == "dry-mud" or GetTileTerrainName(RandomX, RandomY) == "mud") then
							unit = CreateUnit("unit-wyrm-skeleton", PlayerNumNeutral, {RandomX, RandomY})
							Count = Count - 1
						else
							unit = CreateUnit("unit-bones", PlayerNumNeutral, {RandomX, RandomY})
							Count = Count - 1
						end
					end
				elseif (GetTileTerrainName(RandomX, RandomY) == "dwarf-closed-wall" and RandomY < (CMap.Map.Info.MapHeight - 1) and GetNumUnitsAt(PlayerNumNeutral, "any", {RandomX, RandomY}, {RandomX, RandomY}) < 1) then
					if (SyncRand(2) == 0) then
						unit = CreateUnit("unit-outer-wall-decoration", PlayerNumNeutral, {RandomX, RandomY})
					else
						unit = CreateUnit("unit-shelf", PlayerNumNeutral, {RandomX, RandomY})
					end
					Count = Count - 1
				elseif (GetTileTerrainName(RandomX, RandomY) == "dwarf-open-wall" and GetNumUnitsAt(PlayerNumNeutral, "any", {RandomX, RandomY}, {RandomX, RandomY}) < 1) then
					unit = CreateUnit("unit-inner-wall-decoration", PlayerNumNeutral, {RandomX, RandomY})
					Count = Count - 1
				end
				WhileCount = WhileCount + 1
			end
		end
	end
end

function CreatePlayers(min_x, max_x, min_y, max_y, town_halls, symmetric, starting_gold_mine, player_civilizations, player_buildings, water_map, no_raw_tile)
	local settlement_units = {}
	local uncount = GetUnits(PlayerNumNeutral)
	for unit1 = 1,table.getn(uncount) do 
		if (uncount[unit1]) then
			if (GetUnitVariable(uncount[unit1], "Ident") == "unit-settlement-site") then
				table.insert(settlement_units, uncount[unit1])
			end
		end
	end

	-- create player units
	local symmetric_starting_location = {0, 0}
	for i=0,(PlayerMax - 2) do
		if (CMap.Map.Info.PlayerType[i] == PlayerPerson or CMap.Map.Info.PlayerType[i] == PlayerComputer) then
			local faction_type = "tribe"
			if (GameSettings.TechLevel == CivilizedGunpowderTechLevel or GameSettings.TechLevel == CivilizedIronTechLevel or GameSettings.TechLevel == CivilizedBronzeTechLevel) then
				faction_type = "polity"
			end
			
			local possible_civilizations = {}
			if (HasCivilizationAvailableFactions("anglo-saxon") and (GameSettings.TechLevel == AgrarianIronTechLevel or GameSettings.TechLevel == CivilizedIronTechLevel)) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "anglo-saxon")
			end
			if (HasCivilizationAvailableFactions("dwarf")) then
				table.insert(possible_civilizations, "dwarf")
			end
			if (HasCivilizationAvailableFactions("english") and (GameSettings.TechLevel == CivilizedIronTechLevel or GameSettings.TechLevel == CivilizedGunpowderTechLevel)) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "english")
			end
			if (HasCivilizationAvailableFactions("frankish") and (GameSettings.TechLevel == AgrarianIronTechLevel or GameSettings.TechLevel == CivilizedIronTechLevel)) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "frankish")
			end
			if (HasCivilizationAvailableFactions("germanic") and (GameSettings.TechLevel == "" or GameSettings.TechLevel == AgrarianBronzeTechLevel or GameSettings.TechLevel == CivilizedBronzeTechLevel)) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "germanic")
			end
			if (HasCivilizationAvailableFactions("goth") and (GameSettings.TechLevel == AgrarianIronTechLevel or GameSettings.TechLevel == CivilizedIronTechLevel)) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "goth")
			end
			if (HasCivilizationAvailableFactions("norse") and (GameSettings.TechLevel == AgrarianIronTechLevel or GameSettings.TechLevel == CivilizedIronTechLevel or GameSettings.TechLevel == CivilizedGunpowderTechLevel)) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "norse")
			end
			if (HasCivilizationAvailableFactions("suebi") and (GameSettings.TechLevel == AgrarianIronTechLevel or GameSettings.TechLevel == CivilizedIronTechLevel)) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "suebi")
			end
			if (HasCivilizationAvailableFactions("teuton") and (GameSettings.TechLevel == AgrarianIronTechLevel or GameSettings.TechLevel == CivilizedIronTechLevel or GameSettings.TechLevel == CivilizedGunpowderTechLevel)) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "teuton")
			end
			if (GetPlayerData(i, "AiEnabled") and HasCivilizationAvailableFactions("gnome")) then -- allow gnomes in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "gnome")
			end
			if (HasCivilizationAvailableFactions("goblin")) then
				table.insert(possible_civilizations, "goblin")
			end
			if (table.getn(possible_civilizations) < 1) then
				CMap.Map.Info.PlayerType[i] = PlayerNobody
			else
				if (CMap.Map.Info.PlayerType[i] ~= PlayerNobody) then
					if (player_civilizations ~= nil and player_civilizations[i + 1] ~= nil) then
						SetPlayerData(i, "RaceName", player_civilizations[i + 1])
					else
						SetPlayerData(i, "RaceName", possible_civilizations[SyncRand(table.getn(possible_civilizations)) + 1])
					end
				end
				
				local WhileCount = 0
				local player_spawn_point
				local starting_point_found = false
				local has_settlement_site = false
				
				if (table.getn(settlement_units) > 0) then
					starting_point_found = true
					has_settlement_site = true
					local settlement_site
					if (i == 0) then -- for the first player, pick a random settlement site
						settlement_site = settlement_units[SyncRand(table.getn(settlement_units)) + 1]
					else -- for the rest, pick one as distant from other players as possible
						local best_settlement_site_distance = 0
						for j = 1, table.getn(settlement_units) do
							local settlement_site_distance
							for k = 0, (i - 1) do -- every player before this one
								local new_settlement_site_distance = math.sqrt(math.pow(GetUnitVariable(settlement_units[j], "PosX") - CPlayer:GetPlayer(k).StartPos.x, 2) + math.pow(GetUnitVariable(settlement_units[j], "PosY") - CPlayer:GetPlayer(k).StartPos.y, 2))
								
								if (settlement_site_distance) then
									settlement_site_distance = math.min(settlement_site_distance, new_settlement_site_distance)
								else
									settlement_site_distance = new_settlement_site_distance
								end
							end
							if (settlement_site_distance > best_settlement_site_distance) then
								settlement_site = settlement_units[j]
								best_settlement_site_distance = settlement_site_distance
							end
						end
					end
					RemoveElementFromArray(settlement_units, settlement_site)
					unit = CreateUnitOnTop("unit-germanic-town-hall", i, settlement_site)
					player_spawn_point = {GetUnitVariable(unit, "PosX"), GetUnitVariable(unit, "PosY")}
				end
				
				while (starting_point_found == false and WhileCount < 10000) do
					if (CPlayer:GetPlayer(i).StartPos.x > 0 and CPlayer:GetPlayer(i).StartPos.y > 0) then -- if the player already has a custom starting location set, then see if that area (or failing that the one surrounding it) is actually free
						local second_min_x = CPlayer:GetPlayer(i).StartPos.x - WhileCount
						local second_max_x = CPlayer:GetPlayer(i).StartPos.x + WhileCount
						local second_min_y = CPlayer:GetPlayer(i).StartPos.y - WhileCount
						local second_max_y = CPlayer:GetPlayer(i).StartPos.y + WhileCount
						player_spawn_point = {SyncRand(second_max_x - second_min_x + 1) + second_min_x, SyncRand(second_max_y - second_min_y + 1) + second_min_y}
					else
						if (symmetric == false) then
							player_spawn_point = {SyncRand(max_x - min_x + 1) + min_x, SyncRand(max_y - min_y + 1) + min_y}
						else
							if (i == 0 or i == 4 or i == 8 or i == 12) then
								player_spawn_point = {SyncRand(math.floor(max_x / 2) - min_x) + min_x, SyncRand(math.floor(max_y / 2) - min_y) + min_y}
								symmetric_starting_location = player_spawn_point
							elseif (i == 1 or i == 5 or i == 9 or i == 13) then
								player_spawn_point = {math.abs(symmetric_starting_location[1] - (CMap.Map.Info.MapWidth - 1)) - 3, math.abs(symmetric_starting_location[2] - (CMap.Map.Info.MapHeight - 1)) - 3}
							elseif (i == 2 or i == 6 or i == 10 or i == 14) then
								player_spawn_point = {symmetric_starting_location[1], math.abs(symmetric_starting_location[2] - (CMap.Map.Info.MapHeight - 1)) - 3}
							elseif (i == 3 or i == 7 or i == 11) then
								player_spawn_point = {math.abs(symmetric_starting_location[1] - (CMap.Map.Info.MapWidth - 1)) - 3, symmetric_starting_location[2]}
							end
						end
					end

					starting_point_found = true
					if ((player_spawn_point[1] + 4) > (CMap.Map.Info.MapWidth - 1) or (player_spawn_point[2] + 4) > (CMap.Map.Info.MapHeight - 1) or (player_spawn_point[1] - 1) < 0 or (player_spawn_point[2] - 1) < 0) then
						starting_point_found = false
					end
					for j=0,(PlayerMax - 2) do
						if (j < i and (CMap.Map.Info.PlayerType[j] == PlayerPerson or CMap.Map.Info.PlayerType[j] == PlayerComputer)) then
							if (math.abs(player_spawn_point[1] - CPlayer:GetPlayer(j).StartPos.x) < 32 and math.abs(player_spawn_point[2] - CPlayer:GetPlayer(j).StartPos.y) < 32) then -- shouldn't start too close to another player
								starting_point_found = false
							end
						end
					end
					
					if (symmetric) then -- if is symmetric, shouldn't be too close to the end of the quadrant (since then the starting point would be generated too close to another player)
						if (i == 0 or i == 4 or i == 8 or i == 12) then -- only need to check the players who set the spawn point to be replicated
							if (math.abs(player_spawn_point[1] - math.floor(max_x / 2)) < 16 or math.abs(player_spawn_point[2] - math.floor(max_y / 2)) < 16) then
								starting_point_found = false
							end
						end
					end
					
					for sub_x=-4,7 do
						for sub_y=-4,7 do
							if (no_raw_tile) then
								if (GetTileTerrainHasFlag(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y, "no-building") or GetTileTerrainHasFlag(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y, "unpassable") or GetTileTerrainHasFlag(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y, "water")) then
									starting_point_found = false
								end
							else
								if (RawTile(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y) == "Rock" or RawTile(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y) == "Water") then
									starting_point_found = false
								end
							end
						end
					end
					WhileCount = WhileCount + 1
				end
				
				if (CMap.Map.Info.PlayerType[i] ~= PlayerNobody) then
					SetStartView(i, player_spawn_point[1], player_spawn_point[2])

					if (no_raw_tile) then
						if (has_settlement_site == false) then
							unit = CreateUnit("unit-germanic-town-hall", i, {player_spawn_point[1], player_spawn_point[2]})
						end
						unit = CreateUnit("unit-germanic-worker", i, {player_spawn_point[1], player_spawn_point[2]})
						unit = CreateUnit("unit-germanic-worker", i, {player_spawn_point[1], player_spawn_point[2]})
						unit = CreateUnit("unit-germanic-worker", i, {player_spawn_point[1], player_spawn_point[2]})
						unit = CreateUnit("unit-germanic-worker", i, {player_spawn_point[1], player_spawn_point[2]})
						unit = CreateUnit("unit-germanic-worker", i, {player_spawn_point[1], player_spawn_point[2]})
						CreateStartingGoldMine(i, nil, nil, true) -- create the player's gold mine
						if (GetPlayerData(i, "RaceName") == "dwarf") then
							CreateStartingLocationResourcePiles(i, "unit-stone-pile", 12)
							CreateStartingLocationResourcePiles(i, "unit-wood-pile", 4)
						else
							CreateStartingLocationResourcePiles(i, "unit-wood-pile", 16)
						end
					else
						for sub_x=-1,4 do
							for sub_y=-1,4 do
								SetRawTile(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y, "Road")
							end
						end
						if (town_halls) then
							for sub_x=0,3 do
								for sub_y=0,3 do
									SetRawTile(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y, "Town Hall " .. i)
								end
							end
						end
						if (starting_gold_mine) then
							CreateStartingGoldMine(i) -- create the player's gold mine
						end
						if (player_buildings ~= nil and player_buildings[i + 1] ~= nil) then
							for j=1,table.getn(player_buildings[i + 1]) do
								CreateStartingBuilding(i, player_buildings[i + 1][j]) -- give the player initial buildings
							end
						end
					end

					SetPlayerData(i, "Resources", "copper", 5000)
					SetPlayerData(i, "Resources", "lumber", 5000)
					SetPlayerData(i, "Resources", "stone", 5000)

					SetAiType(i, "land-attack")
				end
			end
		end
	end

	SetPlayerData(PlayerNumNeutral, "RaceName", "neutral")
end

function SetMapBorders(tile_type, replace_tile)

	for x=0,(CMap.Map.Info.MapWidth - 1) do
		if (RawTile(x, 0) == "" or replace_tile == true) then
			SetRawTile(x, 0, tile_type)
		end
		if (RawTile(x, 1) == "" or replace_tile == true) then
			SetRawTile(x, 1, tile_type)
		end

		if (RawTile(x, CMap.Map.Info.MapHeight - 2) == "" or replace_tile == true) then
			SetRawTile(x, CMap.Map.Info.MapHeight - 2, tile_type)
		end
		if (RawTile(x, CMap.Map.Info.MapHeight - 1) == "" or replace_tile == true) then
			SetRawTile(x, CMap.Map.Info.MapHeight - 1, tile_type)
		end
	end
	for y=0,(CMap.Map.Info.MapHeight - 1) do
		if (RawTile(0, y) == "" or replace_tile == true) then
			SetRawTile(0, y, tile_type)
		end
		if (RawTile(1, y) == "" or replace_tile == true) then
			SetRawTile(1, y, tile_type)
		end

		if (RawTile(CMap.Map.Info.MapWidth - 2, y) == "" or replace_tile == true) then
			SetRawTile(CMap.Map.Info.MapWidth - 2, y, tile_type)
		end
		if (RawTile(CMap.Map.Info.MapWidth - 1, y) == "" or replace_tile == true) then
			SetRawTile(CMap.Map.Info.MapWidth - 1, y, tile_type)
		end
	end
end

function GenerateRandomMap(arg)
	if (LoadedGame == false) then
		CleanRawTiles()

		if (arg.WaterMap) then
			for x=0,(CMap.Map.Info.MapWidth - 1) do
				for y=0,(CMap.Map.Info.MapHeight - 1) do
					SetRawTile(x, y, "Water")
				end
			end
			if (arg.LandQuantity == "high") then
				GenerateLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 2, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
			elseif (arg.LandQuantity == "medium") then
				GenerateLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 4, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
			elseif (arg.LandQuantity == "low") then
				GenerateLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 8, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
			end
		else
			for x=0,(CMap.Map.Info.MapWidth - 1) do
				for y=0,(CMap.Map.Info.MapHeight - 1) do
					SetRawTile(x, y, "Land")
				end
			end
		end
		
		local symmetric = false
		if (arg.Symmetric) then
			symmetric = true
		end
		
		if (arg.WaterLayout ~= nil) then
			local block_size = 16
			if (CMap.Map.Info.MapWidth > CMap.Map.Info.MapHeight) then
				block_size = CMap.Map.Info.MapWidth / table.getn(arg.WaterLayout[1])
			else
				block_size = CMap.Map.Info.MapHeight / table.getn(arg.WaterLayout)
			end
			
			-- 8 = N/S river
			-- 9 = N/S river + bridge
			-- 10 = E/W river
			-- 11 = E/W river + bridge
			-- 16 = N/W river bend
			-- 17 = N/E river bend
			-- 18 = S/E river bend
			-- 19 = S/W river bend
			-- 20 = N/W/E river fork
			-- 21 = N/S/E river fork
			-- 22 = S/W/E river fork
			-- 23 = N/S/W river fork
			-- 30 = Sea
			-- 31 = North coast
			-- 32 = East coast
			-- 33 = South coast
			-- 34 = West coast
			-- 35 = Northwest outer coast
			-- 36 = Northeast outer coast
			-- 37 = Southeast outer coast
			-- 38 = Southwest outer coast
			-- 39 = Northwest inner coast
			-- 40 = Northeast inner coast
			-- 41 = Southeast inner coast
			-- 42 = Southwest inner coast
			
			local function BuildWaterArea(x, y, t)
				if (t == 8) then -- N/S river
					MakeRandomPath(x + (block_size / 2), y, x + (block_size / 2), y + (block_size - 1), x, y, x + (block_size - 1), y + (block_size - 1), "Water", false)
					SpreadTiles(x, y, x + (block_size - 1), y + (block_size - 1), "Water", "Land")
					AdjustRawMapTileIrregularities(x - 2, x + (block_size + 1), y - 2, y + (block_size + 1), 2, false) -- correct for leftover single tiles
				elseif (t == 9) then -- N/S river + bridge
					MakeRandomPath(x + (block_size / 2), y, x + (block_size / 2), y + (block_size - 1), x, y, x + (block_size - 1), y + (block_size - 1), "Water", false)
					SpreadTiles(x, y, x + (block_size - 1), y + (block_size - 1), "Water", "Land")
					ReplaceTiles(x, y + ((block_size / 2) - 1), x + (block_size - 1), y + ((block_size / 2) - 1) + SyncRand(3) + 1, "Water", "Rough") -- add the bridge
					AdjustRawMapTileIrregularities(x - 2, x + (block_size + 1), y - 2, y + (block_size + 1), 2, false) -- correct for leftover single tiles
				elseif (t == 10) then -- E/W river
					MakeRandomPath(x + (block_size / 2), y, x + (block_size / 2), y + (block_size - 1), x, y, x + (block_size - 1), y + (block_size - 1), "Water", false)
					SpreadTiles(x, y, x + (block_size - 1), y + (block_size - 1), "Water", "Land")
					RotateArea(x, y, block_size, 1)
					AdjustRawMapTileIrregularities(x - 2, x + (block_size + 1), y - 2, y + (block_size + 1), 2, false) -- correct for leftover single tiles
				elseif (t == 11) then -- E/W river + bridge
					MakeRandomPath(x + (block_size / 2), y, x + (block_size / 2), y + (block_size - 1), x, y, x + (block_size - 1), y + (block_size - 1), "Water", false)
					SpreadTiles(x, y, x + (block_size - 1), y + (block_size - 1), "Water", "Land")
					ReplaceTiles(x, y + ((block_size / 2) - 1), x + (block_size - 1), y + ((block_size / 2) - 1) + SyncRand(3) + 1, "Water", "Rough") -- add the bridge
					RotateArea(x, y, block_size, 1)
					AdjustRawMapTileIrregularities(x - 2, x + (block_size + 1), y - 2, y + (block_size + 1), 2, false) -- correct for leftover single tiles
				elseif (t == 16 or t == 17 or t == 18 or t == 19) then -- river bends
					MakeRandomPath(x + (block_size / 2), y, x, y + (block_size / 2), x, y, x + (block_size - 1), y + (block_size - 1), "Water", false)
					SpreadTiles(x, y, x + (block_size - 1), y + (block_size - 1), "Water", "Land")
					RotateArea(x, y, block_size, t - 16) -- rotate clockwise to correct orientation; 16 = N/W position, etc.
					AdjustRawMapTileIrregularities(x - 2, x + (block_size + 1), y - 2, y + (block_size + 1), 2, false) -- correct for leftover single tiles
				elseif (t == 20 or t == 21 or t == 22 or t == 23) then -- river forks
					MakeRandomPath(x + (block_size / 2), y, x, y + (block_size / 2), x, y, x + (block_size - 1), y + (block_size - 1), "Water", false)
					MakeRandomPath(x + (block_size / 2), y, x + (block_size - 1), y + (block_size / 2), x, y, x + (block_size - 1), y + (block_size - 1), "Water", false)
					SpreadTiles(x, y, x + (block_size - 1), y + (block_size - 1), "Water", "Land")
					RotateArea(x, y, block_size, t - 20) -- rotate clockwise to correct orientation; 20 = N/W/E position, etc.
					AdjustRawMapTileIrregularities(x - 2, x + (block_size + 1), y - 2, y + (block_size + 1), 2, false) -- correct for leftover single tiles
				elseif (t == 30) then -- sea
					FillArea(x, y, x + (block_size - 1), y + (block_size - 1), "Water", false)
				elseif (t == 31) then -- North coast
					FillArea(x, y, x + (block_size - 1), y + (block_size - 1), "Land", false)
					FillArea(x, y, x + (block_size - 1), y + 3, "Water", false)
					GenerateWater(0, (8 * block_size - (4 * block_size)), x, x + (block_size - 1), y, y + (block_size - 1)) -- (8 (the water area goal height) * 16 (the water area goal width) - (4 * 16)) (the already filled-in area of water)
				elseif (t == 32) then -- East coast
					FillArea(x, y, x + (block_size - 1), y + (block_size - 1), "Land", false)
					FillArea(x + (block_size * 3 / 4), y, x + (block_size - 1), y + (block_size - 1), "Water", false)
					GenerateWater(0, (8 * block_size - (4 * block_size)), x, x + (block_size - 1), y, y + (block_size - 1), x, x + (block_size - 1), y, y + (block_size - 1))
				elseif (t == 33) then -- South coast
					FillArea(x, y, x + (block_size - 1), y + (block_size - 1), "Land", false)
					FillArea(x, y + (block_size * 3 / 4), x + (block_size - 1), y + (block_size - 1), "Water", false)
					GenerateWater(0, (8 * block_size - (4 * block_size)), x, x + (block_size - 1), y, y + (block_size - 1), x, x + (block_size - 1), y, y + (block_size - 1))
				elseif (t == 34) then -- West coast
					FillArea(x, y, x + (block_size - 1), y + (block_size - 1), "Land", false)
					FillArea(x, y, x + 3, y + (block_size - 1), "Water", false)
					GenerateWater(0, (8 * block_size - (4 * block_size)), x, x + (block_size - 1), y, y + (block_size - 1), x, x + (block_size - 1), y, y + (block_size - 1))
				elseif (t == 35) then -- Northwest outer coast
					FillArea(x, y, x + (block_size - 1), y + (block_size - 1), "Land", false)
					FillArea(x, y, x + (block_size - 1), y + 3, "Water", false)
					FillArea(x, y, x + 3, y + (block_size - 1), "Water", false)
					GenerateWater(0, (8 * block_size - (3 * block_size)), x, x + (block_size - 1), y, y + (block_size - 1))
				elseif (t == 36) then -- Northeast outer coast
					FillArea(x, y, x + (block_size - 1), y + (block_size - 1), "Land", false)
					FillArea(x, y, x + (block_size - 1), y + 3, "Water", false)
					FillArea(x + (block_size * 3 / 4), y, x + (block_size - 1), y + (block_size - 1), "Water", false)
					GenerateWater(0, (8 * block_size - (3 * block_size)), x, x + (block_size - 1), y, y + (block_size - 1))
				elseif (t == 39) then -- Northwest inner coast
					FillArea(x, y, x + (block_size - 1), y + (block_size - 1), "Land", false)
					FillArea(x, y, x + 3, y + 3, "Water", false)
					GenerateWater(0, (8 * block_size - (5 * block_size)), x, x + (block_size - 1), y, y + (block_size - 1))
				elseif (t == 40) then -- Northeast inner coast
					FillArea(x, y, x + (block_size - 1), y + (block_size - 1), "Land", false)
					FillArea(x + (block_size * 3 / 4), y, x + (block_size - 1), y + 3, "Water", false)
					GenerateWater(0, (8 * block_size - (5 * block_size)), x, x + (block_size - 1), y, y + (block_size - 1))
				end
			end

			for ay=1,table.getn(arg.WaterLayout) do
				for ax=1,table.getn(arg.WaterLayout[ay]) do
					BuildWaterArea((ax-1) * block_size, (ay-1) * block_size, arg.WaterLayout[ay][ax])
				end
			end
		end
		
		if (arg.RockGenerationAreas) then
			for i=1,table.getn(arg.RockGenerationAreas) do
				GenerateRocks((((arg.RockGenerationAreas[i][2] - arg.RockGenerationAreas[i][1]) * (arg.RockGenerationAreas[i][4] - arg.RockGenerationAreas[i][3])) / 32), (((arg.RockGenerationAreas[i][2] - arg.RockGenerationAreas[i][1]) * (arg.RockGenerationAreas[i][4] - arg.RockGenerationAreas[i][3])) / 4), "Land", arg.RockGenerationAreas[i][1], arg.RockGenerationAreas[i][2], arg.RockGenerationAreas[i][3], arg.RockGenerationAreas[i][4])
			end
		end
		
		if (arg.WaterQuantity == "high") then
			GenerateWater((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 8, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		elseif (arg.WaterQuantity == "medium") then
			GenerateWater((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 16, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		elseif (arg.WaterQuantity == "low") then
			GenerateWater((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 32, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		end
		
		if (arg.WaterLayout ~= nil) then -- make sure the bridges will be present
			local block_size = 16
			if (CMap.Map.Info.MapWidth > CMap.Map.Info.MapHeight) then
				block_size = CMap.Map.Info.MapWidth / table.getn(arg.WaterLayout[1])
			else
				block_size = CMap.Map.Info.MapHeight / table.getn(arg.WaterLayout)
			end
			
			for ay=1,table.getn(arg.WaterLayout) do
				for ax=1,table.getn(arg.WaterLayout[ay]) do
					local x = (ax-1) * block_size
					local y = (ay-1) * block_size
					if (arg.WaterLayout[ay][ax] == 9) then
						ReplaceTiles(x, y + ((block_size / 2) - 1), x + (block_size - 1), y + ((block_size / 2) - 1) + SyncRand(3) + 1, "Water", "Rough")
						AdjustRawMapTileIrregularities(x - 2, x + (block_size + 1), y - 2, y + (block_size + 1), 2, false) -- correct for leftover single tiles
					elseif (arg.WaterLayout[ay][ax] == 11) then
						ReplaceTiles(x + ((block_size / 2) - 1), y, x + ((block_size / 2) - 1) + SyncRand(3) + 1, y + (block_size - 1), "Water", "Rough")
						AdjustRawMapTileIrregularities(x - 2, x + (block_size + 1), y - 2, y + (block_size + 1), 2, false) -- correct for leftover single tiles
					end
				end
			end
		end
			
		if (arg.RockQuantity == "high") then
			GenerateRocks((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, ((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 8), "Land", 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		elseif (arg.RockQuantity == "medium") then
			GenerateRocks((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, ((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 16), "Land", 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		elseif (arg.RockQuantity == "low") then
			GenerateRocks((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, ((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 32), "Land", 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		end

		AdjustTransitions(0, CMap.Map.Info.MapWidth - 1, 0, CMap.Map.Info.MapHeight - 1)
		
		if (arg.StartingLocationLayout ~= nil) then
			-- -2 = Not available as a random start location
			-- -1 = Available random start location
			-- 0+ = Starting location of a particular player
			
			local player_starting_location_found = {false, false, false, false, false, false, false, false, false, false, false, false, false, false, false, false}
			local random_starting_locations = {}
			for ay=1,table.getn(arg.StartingLocationLayout) do
				for ax=1,table.getn(arg.StartingLocationLayout[ay]) do
					if (arg.StartingLocationLayout[ay][ax] == -1) then
						table.insert(random_starting_locations, {ax, ay})
					elseif (arg.StartingLocationLayout[ay][ax] >= 0) then
						player_starting_location_found[arg.StartingLocationLayout[ay][ax] + 1] = true
					end
				end
			end

			for i=0,(PlayerMax - 2) do
				if (player_starting_location_found[i + 1] == false and table.getn(random_starting_locations) > 0) then
					local player_starting_location = random_starting_locations[SyncRand(table.getn(random_starting_locations)) + 1]
					RemoveElementFromArray(random_starting_locations, player_starting_location)
					arg.StartingLocationLayout[player_starting_location[2]][player_starting_location[1]] = i
				end
			end
		
			local block_size = 16
			if (CMap.Map.Info.MapWidth > CMap.Map.Info.MapHeight) then
				block_size = CMap.Map.Info.MapWidth / table.getn(arg.StartingLocationLayout[1])
			else
				block_size = CMap.Map.Info.MapHeight / table.getn(arg.StartingLocationLayout)
			end
			
			local function BuildArea(x, y, t)
				if (t >= 0) then -- town center
					local player_starting_point = {x + SyncRand(block_size - 3), y + SyncRand(block_size - 3)}
					SetStartView(t, player_starting_point[1], player_starting_point[2])
				end
			end

			for ay=1,table.getn(arg.StartingLocationLayout) do
				for ax=1,table.getn(arg.StartingLocationLayout[ay]) do
					BuildArea((ax-1) * block_size, (ay-1) * block_size, arg.StartingLocationLayout[ay][ax])
				end
			end
		end
		
		CreatePlayers(0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight, not arg.NoTownHall, symmetric, not arg.NoDeposits, arg.PlayerCivilizations, arg.PlayerBuildings, arg.WaterMap) -- generate players after rocks and water

		if (arg.RoughLandQuantity == "high") then
			GenerateRoughLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 8)
		elseif (arg.RoughLandQuantity == "medium") then
			GenerateRoughLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 16)
		elseif (arg.RoughLandQuantity == "low") then
			GenerateRoughLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 32)
		end

		if (arg.DarkRoughLandQuantity == "high") then
			GenerateDarkRoughLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 256, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 32, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight, "Rough")
		elseif (arg.DarkRoughLandQuantity == "medium") then
			GenerateDarkRoughLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 128, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight, "Rough")
		elseif (arg.DarkRoughLandQuantity == "low") then
			GenerateDarkRoughLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 256, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight, "Rough")
		end

		if (arg.TreeQuantity == "high") then
			GenerateTrees((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 512, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 8, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		elseif (arg.TreeQuantity == "medium") then
			GenerateTrees((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 16, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		elseif (arg.TreeQuantity == "low") then
			GenerateTrees((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 2048, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 32, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		end

		if (arg.DarkLandQuantity == "high") then
			GenerateDarkLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 256, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 32, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		elseif (arg.DarkLandQuantity == "medium") then
			GenerateDarkLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 128, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		elseif (arg.DarkLandQuantity == "low") then
			GenerateDarkLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 256, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		end

		if (arg.DarkWaterQuantity == "high") then
			GenerateDarkWater((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 256, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 32, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		elseif (arg.DarkWaterQuantity == "medium") then
			GenerateDarkWater((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 512, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 64, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		elseif (arg.DarkWaterQuantity == "low") then
			GenerateDarkWater((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 128, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)
		end

		if (symmetric) then
			for x=(CMap.Map.Info.MapWidth / 2),(CMap.Map.Info.MapWidth - 1) do
				for y=0,(CMap.Map.Info.MapHeight - 1) do
					local mirrored_tile_x = x + 1 - 128
					if (mirrored_tile_x < 0) then
						mirrored_tile_x = mirrored_tile_x * -1
					end
					if (string.find(RawTile(x, y), "Town Hall") == nil and string.find(RawTile(mirrored_tile_x, y), "Town Hall") == nil) then
						SetRawTile(x, y, RawTile(mirrored_tile_x, y))
					end
				end
			end

			for x=0,(CMap.Map.Info.MapWidth - 1) do
				for y=(CMap.Map.Info.MapHeight / 2),(CMap.Map.Info.MapHeight - 1) do
					local mirrored_tile_y = y + 1 - 128
					if (mirrored_tile_y < 0) then
						mirrored_tile_y = mirrored_tile_y * -1
					end
					if (string.find(RawTile(x, y), "Town Hall") == nil and string.find(RawTile(x, mirrored_tile_y), "Town Hall") == nil) then
