			if (GetTileTerrainHasFlag(RandomX, RandomY, "land") and GetTileTerrainHasFlag(RandomX, RandomY, "unpassable") == false and GetTileTerrainHasFlag(RandomX, RandomY, "no-building") == false and GetTileTerrainHasFlag(RandomX + 1, RandomY + 1, "land") and GetTileTerrainHasFlag(RandomX + 1, RandomY + 1, "unpassable") == false and GetTileTerrainHasFlag(RandomX + 1, RandomY + 1, "no-building") == false and GetTileTerrainHasFlag(RandomX + 2, RandomY + 2, "land") and GetTileTerrainHasFlag(RandomX + 2, RandomY + 2, "unpassable") == false and GetTileTerrainHasFlag(RandomX + 2, RandomY + 2, "no-building") == false and GetTileTerrainHasFlag(RandomX + 3, RandomY + 3, "land") and GetTileTerrainHasFlag(RandomX + 3, RandomY + 3, "unpassable") == false and GetTileTerrainHasFlag(RandomX + 3, RandomY + 3, "no-building") == false) then
				local unit_quantity = 0
				for i=0,(PlayerMax - 2) do
					unit_quantity = unit_quantity + GetNumUnitsAt(i, "any", {RandomX - 16, RandomY - 16}, {RandomX + 16, RandomY + 16})
				end

				local gold_mine_quantity = GetNumUnitsAt(PlayerNumNeutral, "unit-gold-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-silver-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-copper-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-iron-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-mithril-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-diamond-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-emerald-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8})
				local close_gold_mine_quantity = GetNumUnitsAt(PlayerNumNeutral, "unit-gold-deposit", {RandomX - 6, RandomY - 6}, {RandomX + 6, RandomY + 6}) + GetNumUnitsAt(PlayerNumNeutral, "unit-silver-deposit", {RandomX - 6, RandomY - 6}, {RandomX + 6, RandomY + 6}) + GetNumUnitsAt(PlayerNumNeutral, "unit-copper-deposit", {RandomX - 6, RandomY - 6}, {RandomX + 6, RandomY + 6}) + GetNumUnitsAt(PlayerNumNeutral, "unit-iron-deposit", {RandomX - 6, RandomY - 6}, {RandomX + 6, RandomY + 6}) + GetNumUnitsAt(PlayerNumNeutral, "unit-mithril-deposit", {RandomX - 6, RandomY - 6}, {RandomX + 6, RandomY + 6}) + GetNumUnitsAt(PlayerNumNeutral, "unit-diamond-deposit", {RandomX - 6, RandomY - 6}, {RandomX + 6, RandomY + 6}) + GetNumUnitsAt(PlayerNumNeutral, "unit-emerald-deposit", {RandomX - 6, RandomY - 6}, {RandomX + 6, RandomY + 6})

				if (unit_quantity < 1 and gold_mine_quantity >= 1 and close_gold_mine_quantity < 1) then
					location_found = true
				end
			end
			WhileCount = WhileCount + 1
		end
		return {RandomX, RandomY}
	end
end

function FindAppropriateGoldMineSpawnPoint(min_x, max_x, min_y, max_y, symmetric)
	if (LoadedGame == false) then
		local RandomX = 0
		local RandomY = 0
		local location_found = false
		local WhileCount = 0
		while (location_found == false and WhileCount < 100) do
			if (symmetric) then
				RandomX = SyncRand((CMap.Map.Info.MapWidth / 2) - 24)
				RandomY = SyncRand((CMap.Map.Info.MapHeight / 2) - 24)
			else
				RandomX = SyncRand(max_x - min_x + 1) + min_x
				RandomY = SyncRand(max_y - min_y + 1) + min_y
			end
			
			local unit_quantity = GetNumUnitsAt(PlayerNumNeutral, "unit-gold-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-silver-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-copper-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-iron-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-mithril-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-coal-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-diamond-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(PlayerNumNeutral, "unit-emerald-deposit", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(-1, "unit-dwarven-town-hall", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(-1, "unit-germanic-town-hall", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(-1, "unit-gnomish-town-hall", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(-1, "unit-goblin-town-hall", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(-1, "unit-teuton-town-hall", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(-1, "unit-latin-town-hall", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8}) + GetNumUnitsAt(-1, "unit-norse-town-hall", {RandomX - 8, RandomY - 8}, {RandomX + 8, RandomY + 8})
			
			if (unit_quantity < 1) then
				local space_available = true
				for sub_x=-2,4 do
					for sub_y=-2,4 do
						if (GetTileTerrainHasFlag(RandomX + sub_x, RandomY + sub_y, "land") == false or GetTileTerrainHasFlag(RandomX + sub_x, RandomY + sub_y, "unpassable")) then
							space_available = false
							break
						end
					end
				end
				for sub_x=0,2 do
					for sub_y=0,2 do
						if (GetTileTerrainHasFlag(RandomX + sub_x, RandomY + sub_y, "no-building")) then
							space_available = false
							break
						end
					end
				end
				if (space_available) then
					location_found = true
				end
			end
			WhileCount = WhileCount + 1
		end
		return {RandomX, RandomY}
	end
end

function FindAppropriateNeutralBuildingSpawnPoint(building_type, min_x, max_x, min_y, max_y, symmetric)
	if (LoadedGame == false) then
		local RandomX = 0
		local RandomY = 0
		local location_found = false
		local WhileCount = 0
		if (symmetric) then
			max_x = max_x / 2
			max_y = max_y / 2
		end
		while (location_found == false and WhileCount < 1000) do
			RandomX = SyncRand(max_x - min_x + 1) + min_x
			RandomY = SyncRand(max_y - min_y + 1) + min_y
			
			local in_buildable_land = true

			if (symmetric) then
				if (math.abs(RandomX - max_x) < 16 or math.abs(RandomY - max_y) < 16) then
					in_buildable_land = false
				end
			end
			
			if (in_buildable_land) then
				for x_offset=0, (GetUnitTypeData(building_type, "TileWidth") - 1) do
					for y_offset=0, (GetUnitTypeData(building_type, "TileHeight") - 1) do
						if (GetTileTerrainHasFlag(RandomX + x_offset, RandomY + y_offset, "land") == false or GetTileTerrainHasFlag(RandomX + x_offset, RandomY + y_offset, "unpassable") or GetTileTerrainHasFlag(RandomX + x_offset, RandomY + y_offset, "no-building")) then
							in_buildable_land = false
						end
					end
				end
			end

			if (in_buildable_land) then
				local unit_quantity = 0
				for i=0,(PlayerMax - 2) do
					unit_quantity = unit_quantity + GetNumUnitsAt(i, "any", {RandomX - 16, RandomY - 16}, {RandomX + (GetUnitTypeData(building_type, "TileWidth") - 1) + 16, RandomY + (GetUnitTypeData(building_type, "TileHeight") - 1) + 16})
				end

				unit_quantity = unit_quantity + GetNumUnitsAt(PlayerNumNeutral, "buildings", {RandomX - 16, RandomY - 16}, {RandomX + (GetUnitTypeData(building_type, "TileWidth") - 1) + 16, RandomY + (GetUnitTypeData(building_type, "TileHeight") - 1) + 16}) + GetNumUnitsAt(PlayerNumNeutral, building_type, {RandomX - 16, RandomY - 16}, {RandomX + (GetUnitTypeData(building_type, "TileWidth") - 1) + 16, RandomY + (GetUnitTypeData(building_type, "TileHeight") - 1) + 16})

				if (unit_quantity < 1) then
					location_found = true
				end
			end
			WhileCount = WhileCount + 1
		end
		return {RandomX, RandomY}
	end
end

function FindUnusedPlayerSlot()
	for i=0,(PlayerMax - 2) do
		if (CPlayer:GetPlayer(i).Type == PlayerNobody) then
			return i
		end
	end
	return -1
end

function GetTileTerrainCount(terrain)
	local tile_terrain_count = 0

	for x=0,(CMap.Map.Info.MapWidth - 1) do
		for y=0,(CMap.Map.Info.MapHeight - 1) do
			if (GetTileTerrainName(x, y) == terrain) then
				tile_terrain_count = tile_terrain_count + 1
			end
		end
	end

	return tile_terrain_count
end

function GetTileTerrainFlagCount(flag)
	local tile_flag_count = 0

	for x=0,(CMap.Map.Info.MapWidth - 1) do
		for y=0,(CMap.Map.Info.MapHeight - 1) do
			if (GetTileTerrainHasFlag(x, y, flag)) then
				tile_flag_count = tile_flag_count + 1
			end
		end
	end

	return tile_flag_count
end

function AdjustRawMapTileIrregularities(min_x, max_x, min_y, max_y, count, adjust_transitions)
	for x=min_x,max_x do
		for y=min_y,max_y do
			if (RawTile(x, y) == "Mush") then
				SetRawTile(x, y, "Land")
				if (SyncRand(4) <= 2) then
					unit = CreateUnit("unit-mushroom-patch", PlayerNumNeutral, {x, y})
				end
			elseif (RawTile(x, y) == "Tree" and GetCurrentTileset() == "cave" or GetCurrentTileset() == "dungeon") then -- if the cave or dungeon tileset is being used, then the trees are wood pile objects instead, and the tile is set to buildable land
				SetRawTile(x, y, "Land")
				unit = CreateUnit("unit-wood-pile", PlayerNumNeutral, {x, y})
			end
		end
	end

	if (count == nil) then
		count = 4
	end
	if (adjust_transitions == nil) then
		adjust_transitions = true
	end
	for i=1,count do
		for x=min_x,max_x do
			for y=min_y,max_y do
				if (RawTile(x, y) == "Rock") then
					local adjacent_tiles = 0
					for adjacent_x=(x - 1),(x + 1) do
						if (RawTile(adjacent_x, y) ~= "Rock") then
							adjacent_tiles = adjacent_tiles + 1
						end
					end
					for adjacent_y=(y - 1),(y + 1) do
						if (RawTile(x, adjacent_y) ~= "Rock") then
							adjacent_tiles = adjacent_tiles + 1
						end
					end
					if (adjacent_tiles >= 3) then
						SetRawTile(x, y, "Rough")
					end
				elseif (RawTile(x, y) == "Water") then
					local horizontal_adjacent_tiles = 0
					for adjacent_x=(x - 1),(x + 1) do
						if (RawTile(adjacent_x, y) ~= "Water") then
							horizontal_adjacent_tiles = horizontal_adjacent_tiles + 1
						end
					end
					local vertical_adjacent_tiles = 0
					for adjacent_y=(y - 1),(y + 1) do
						if (RawTile(x, adjacent_y) ~= "Water") then
							vertical_adjacent_tiles = vertical_adjacent_tiles + 1
						end
					end
					if (horizontal_adjacent_tiles >= 2 or vertical_adjacent_tiles >= 2) then
						SetRawTile(x, y, "Rough")
					end 
				elseif (RawTile(x, y) == "Rough") then
					local horizontal_adjacent_tiles = 0
					for adjacent_x=(x - 1),(x + 1) do
						if (RawTile(adjacent_x, y) == "Water") then
							horizontal_adjacent_tiles = horizontal_adjacent_tiles + 1
						end
					end
					local vertical_adjacent_tiles = 0
					for adjacent_y=(y - 1),(y + 1) do
						if (RawTile(x, adjacent_y) == "Water") then
							vertical_adjacent_tiles = vertical_adjacent_tiles + 1
						end
					end
					if (horizontal_adjacent_tiles >= 2 or vertical_adjacent_tiles >= 2) then
						SetRawTile(x, y, "Water")
					end 

					horizontal_adjacent_tiles = 0
					for adjacent_x=(x - 1),(x + 1) do
						if (RawTile(adjacent_x, y) == "Rock") then
							horizontal_adjacent_tiles = horizontal_adjacent_tiles + 1
						end
					end
					vertical_adjacent_tiles = 0
					for adjacent_y=(y - 1),(y + 1) do
						if (RawTile(x, adjacent_y) == "Rock") then
							vertical_adjacent_tiles = vertical_adjacent_tiles + 1
						end
					end
					if (horizontal_adjacent_tiles >= 2 or vertical_adjacent_tiles >= 2) then
						SetRawTile(x, y, "Rock")
					end 

					horizontal_adjacent_tiles = 0
					for adjacent_x=(x - 1),(x + 1) do
						if (RawTile(adjacent_x, y) == "Tree") then
							horizontal_adjacent_tiles = horizontal_adjacent_tiles + 1
						end
					end
					vertical_adjacent_tiles = 0
					for adjacent_y=(y - 1),(y + 1) do
						if (RawTile(x, adjacent_y) == "Tree") then
							vertical_adjacent_tiles = vertical_adjacent_tiles + 1
						end
					end
					if (horizontal_adjacent_tiles >= 2 or vertical_adjacent_tiles >= 2) then
						SetRawTile(x, y, "Tree")
					end 

					horizontal_adjacent_tiles = 0
					for adjacent_x=(x - 1),(x + 1) do
						if (RawTile(adjacent_x, y) ~= "Rough") then
							horizontal_adjacent_tiles = horizontal_adjacent_tiles + 1
						end
					end
					vertical_adjacent_tiles = 0
					for adjacent_y=(y - 1),(y + 1) do
						if (RawTile(x, adjacent_y) ~= "Rough") then
							vertical_adjacent_tiles = vertical_adjacent_tiles + 1
						end
					end
					if (horizontal_adjacent_tiles >= 2 or vertical_adjacent_tiles >= 2) then
						SetRawTile(x, y, "Land")
					end 
				elseif (RawTile(x, y) == "Tree") then
					local horizontal_adjacent_tiles = 0
					for adjacent_x=(x - 1),(x + 1) do
						if (RawTile(adjacent_x, y) ~= "Tree") then
							horizontal_adjacent_tiles = horizontal_adjacent_tiles + 1
						end
					end
					local vertical_adjacent_tiles = 0
					for adjacent_y=(y - 1),(y + 1) do
						if (RawTile(x, adjacent_y) ~= "Tree") then
							vertical_adjacent_tiles = vertical_adjacent_tiles + 1
						end
					end
					if (horizontal_adjacent_tiles >= 2 or vertical_adjacent_tiles >= 2) then
						SetRawTile(x, y, "Land")
					end 
				elseif (RawTile(x, y) == "Land") then
					local horizontal_adjacent_tiles = 0
					for adjacent_x=(x - 1),(x + 1) do
						if (RawTile(adjacent_x, y) == "Water") then
							horizontal_adjacent_tiles = horizontal_adjacent_tiles + 1
						end
					end
					local vertical_adjacent_tiles = 0
					for adjacent_y=(y - 1),(y + 1) do
						if (RawTile(x, adjacent_y) == "Water") then
							vertical_adjacent_tiles = vertical_adjacent_tiles + 1
						end
					end
					if (horizontal_adjacent_tiles >= 2 or vertical_adjacent_tiles >= 2) then
						SetRawTile(x, y, "Water")
					end 

					horizontal_adjacent_tiles = 0
					for adjacent_x=(x - 1),(x + 1) do
						if (RawTile(adjacent_x, y) == "Rock") then
							horizontal_adjacent_tiles = horizontal_adjacent_tiles + 1
						end
					end
					vertical_adjacent_tiles = 0
					for adjacent_y=(y - 1),(y + 1) do
						if (RawTile(x, adjacent_y) == "Rock") then
							vertical_adjacent_tiles = vertical_adjacent_tiles + 1
						end
					end
					if (horizontal_adjacent_tiles >= 2 or vertical_adjacent_tiles >= 2) then
						SetRawTile(x, y, "Rock")
					end 

					horizontal_adjacent_tiles = 0
					for adjacent_x=(x - 1),(x + 1) do
						if (RawTile(adjacent_x, y) == "Tree") then
							horizontal_adjacent_tiles = horizontal_adjacent_tiles + 1
						end
					end
					vertical_adjacent_tiles = 0
					for adjacent_y=(y - 1),(y + 1) do
						if (RawTile(x, adjacent_y) == "Tree") then
							vertical_adjacent_tiles = vertical_adjacent_tiles + 1
						end
					end
					if (horizontal_adjacent_tiles >= 2 or vertical_adjacent_tiles >= 2) then
						SetRawTile(x, y, "Tree")
					end 
				end
			end
		end
		
		if (adjust_transitions) then
			AdjustTransitions(min_x, max_x, min_y, max_y)
		end
	end

	-- destroy mushrooms that ended up in inappropriate locations
	if (GetNumUnitsAt(PlayerNumNeutral, "unit-mushroom-patch", {0, 0}, {512, 512}) >= 1) then
		local uncount = 0
		uncount = GetUnits(PlayerNumNeutral)
		for unit1 = 1,table.getn(uncount) do 
			if (uncount[unit1]) then
				if (GetUnitVariable(uncount[unit1], "Ident") == "unit-mushroom-patch") then
					if (GetUnitVariable(uncount[unit1],"PosX") >= min_x and GetUnitVariable(uncount[unit1],"PosX") <= max_x and GetUnitVariable(uncount[unit1],"PosY") >= min_y and GetUnitVariable(uncount[unit1],"PosY") <= max_y) then
						if (RawTile(GetUnitVariable(uncount[unit1],"PosX"), GetUnitVariable(uncount[unit1],"PosY")) == "Water" or RawTile(GetUnitVariable(uncount[unit1],"PosX"), GetUnitVariable(uncount[unit1],"PosY")) == "Rock" or RawTile(GetUnitVariable(uncount[unit1],"PosX"), GetUnitVariable(uncount[unit1],"PosY")) == "Tree") then
							SetUnitVariable(uncount[unit1], "HitPoints", 0)
						end
					end
				end
			end
		end
	end
end

function AdjustTransitions(min_x, max_x, min_y, max_y)
	if (LoadedGame) then
		return;
	end
	
	for x=min_x,max_x do
		for y=min_y,max_y do
			-- convert buildable land tiles adjacent to water tiles into rough land
			if ((RawTile(x, y) == "Land" or RawTile(x, y) == "Tree" or RawTile(x, y) == "Road" or RawTile(x, y) == "Mush") and (RawTile(x, y + 1) == "Water" or RawTile(x, y - 1) == "Water" or RawTile(x - 1, y) == "Water" or RawTile(x + 1, y) == "Water" or RawTile(x - 1, y - 1) == "Water" or RawTile(x + 1, y - 1) == "Water" or RawTile(x - 1, y + 1) == "Water" or RawTile(x + 1, y + 1) == "Water")) then
				SetRawTile(x, y, "Rough")
			end

			-- convert buildable land tiles adjacent to rock tiles into rough land
			if ((RawTile(x, y) == "Land" or RawTile(x, y) == "Tree" or RawTile(x, y) == "Road" or RawTile(x, y) == "Mush") and (RawTile(x, y + 1) == "Rock" or RawTile(x, y - 1) == "Rock" or RawTile(x - 1, y) == "Rock" or RawTile(x + 1, y) == "Rock" or RawTile(x - 1, y - 1) == "Rock" or RawTile(x + 1, y - 1) == "Rock" or RawTile(x - 1, y + 1) == "Rock" or RawTile(x + 1, y + 1) == "Rock")) then
				SetRawTile(x, y, "Rough")
			end
		end
	end
end

