function ConvertHexTiles()
	if (LoadedGame) then
		return;
	end
	
	local hex_indent = false
	for x=0,(table.getn(HexTiles[1]) - 1) do
		for y=0,(table.getn(HexTiles) - 1) do
			if (hex_indent == false) then
				SetRawTile(x * 2, y * 2, HexTiles[y+1][x+1])
				SetRawTile((x * 2) + 1, y * 2, HexTiles[y+1][x+1])
				SetRawTile(x * 2, (y * 2) + 1, HexTiles[y+1][x+1])
				SetRawTile((x * 2) + 1, (y * 2) + 1, HexTiles[y+1][x+1])
			elseif (hex_indent == true) then
				SetRawTile(x * 2, (y * 2) - 1, HexTiles[y+1][x+1])
				SetRawTile((x * 2) + 1, (y * 2) - 1, HexTiles[y+1][x+1])
				SetRawTile(x * 2, y * 2, HexTiles[y+1][x+1])
				SetRawTile((x * 2) + 1, y * 2, HexTiles[y+1][x+1])

				SetRawTile(x * 2, (y * 2) + 1, HexTiles[y+1][x+1]) -- this is here so the last tiles of indented converted hexes don't end up being blank
				SetRawTile((x * 2) + 1, (y * 2) + 1, HexTiles[y+1][x+1])
			end
		end
		if (hex_indent == false) then
			hex_indent = true
		elseif (hex_indent == true) then
			hex_indent = false
		end
	end
end

function FillArea(x1, y1, x2, y2, tile_type, adjust_transitions)
	if (x1 > x2) then
		local t = x1
		x1 = x2
		x2 = t
	end
	if (y1 > y2) then
		local t = y1
		y1 = y2
		y2 = t
	end
	for x=x1,x2 do
		for y=y1,y2 do
			SetRawTile(x, y, tile_type)
		end
	end

	if (adjust_transitions) then
		for x=x1-1,x2+1 do
			for y=y1-1,y2+1 do
				-- convert buildable land tiles adjacent to water tiles into rough land
				if ((RawTile(x, y) == "Land" or RawTile(x, y) == "Tree") and (RawTile(x, y + 1) == "Water" or RawTile(x, y - 1) == "Water" or RawTile(x - 1, y) == "Water" or RawTile(x + 1, y) == "Water" or RawTile(x - 1, y - 1) == "Water" or RawTile(x + 1, y - 1) == "Water" or RawTile(x - 1, y + 1) == "Water" or RawTile(x + 1, y + 1) == "Water")) then
					SetRawTile(x, y, "Rough")
				end

				-- convert buildable land tiles adjacent to rock tiles into rough land
				if ((RawTile(x, y) == "Land" or RawTile(x, y) == "Tree") and (RawTile(x, y + 1) == "Rock" or RawTile(x, y - 1) == "Rock" or RawTile(x - 1, y) == "Rock" or RawTile(x + 1, y) == "Rock" or RawTile(x - 1, y - 1) == "Rock" or RawTile(x + 1, y - 1) == "Rock" or RawTile(x - 1, y + 1) == "Rock" or RawTile(x + 1, y + 1) == "Rock")) then
					SetRawTile(x, y, "Rough")
				end
			end
		end
	end
end

function FindFreeSquare(x1, y1, x2, y2, width, height)
	local x
	local y
	-- prefer completely free squares
	for i=(5 * (x2 - x1 + 2) * (y2 - y1 + 2)),1,-1 do
		x = rspread(x1, x2)
		y = rspread(y1, y2)
		local tile = RawTile(x, y)
		if (tile ~= "" and GetNumUnitsAt(-1, "any", {x, y}, {x + width - 1, y + height - 1}) == 0) then
			local free_square = true
			for sub_x=1,width do
				for sub_y=1,height do
					if (RawTile(x + sub_x - 1, y + sub_y - 1) ~= "Land" and RawTile(x + sub_x - 1, y + sub_y - 1) ~= "Rough" and RawTile(x + sub_x - 1, y + sub_y - 1) ~= "Dark-Land" and RawTile(x + sub_x - 1, y + sub_y - 1) ~= "Dark-Rough") then
						free_square = false
					end
				end
			end
			if (free_square) then
				return {x, y}
			end
		end
	end
	-- make do with unblocked squares
	--[[
	for i=(5 * (x2 - x1 + 2) * (y2 - y1 + 2)),1,-1 do
		x = rspread(x1, x2)
		y = rspread(y1, y2)
		local tile = RawTile(x, y)
		if (tile == "") then
			continue
		end
		if (GetNumUnitsAt(-1, "any", {x, y}, {x, y}) and (tile == "Land" or tile == "Rough" or tile == "Dark-Land" or tile == "Dark-Rough")) then
			return {x, y}
		end
	end
	--]]
	return nil
end

function Fractalize(x1, y1, x2, y2, gran)
	local RandomNumber = 0

	-- ensure workable size
	x2=x1+((x2-x1)/gran)*gran-1
	y2=y1+((y2-y1)/gran)*gran-1
	
	local g = gran / 2
	if (g < 1) then
		return
	end
	for y=y1,y2,gran do
		for x=x1,x2,gran do
			if (SyncRand(2) == 0) then
				SetRawTile(x + g, y, RawTile(x, y))
			else
				SetRawTile(x + g, y, RawTile(x + gran, y))
			end
			if (SyncRand(2) == 0) then
				SetRawTile(x, y + g, RawTile(x, y))
			else
				SetRawTile(x, y + g, RawTile(x, y + gran))
			end
		end
	end

	-- now do middle tile
	for y=y1,y2,gran do
		for x=x1,x2,gran do
			local c
			RandomNumber = dice(1, 4)
			if (RandomNumber == 1) then
				c = RawTile(x + g, y)
			elseif (RandomNumber == 2) then
				c = RawTile(x + g, y + gran)
			elseif (RandomNumber == 3) then
				c = RawTile(x, y + g)
			elseif (RandomNumber == 4) then
				c = RawTile(x + gran, y + g)
			end
			SetRawTile(x + g, y + g, c)
		end
	end
	
	-- continue down to next level of detail
	if (g > 1) then
		Fractalize(x1, y1, x2, y2, g)
	end
end

function MakeRandomPath(x1, y1, x2, y2, x3, y3, x4, y4, c, diagonals)
	local dx
	local dy
	local WhileCount = 0
	while (((x1 ~= x2) or (y1 ~= y2)) and WhileCount < 10000) do
		SetRawTile(x1, y1, c)
		if (dice(1, 3) == 1) then
			dx = sign(x2 - x1)
			dy = sign(y2 - y1)
		else
			dx = SyncRand(3) - 1
			dy = SyncRand(3) - 1
		end
		local RandomNumber
		if (diagonals) then
			RandomNumber = dice(1, 3)
		else
			RandomNumber = dice(1, 2)
		end
		if (RandomNumber == 1) then
			dx = 0
		elseif (RandomNumber == 2) then
			dy = 0
		end
		x1 = x1 + dx
		y1 = y1 + dy
		x1 = middle(x3, x1, x4)
		y1 = middle(y3, y1, y4)
		WhileCount = WhileCount + 1
	end
	SetRawTile(x2, y2, c)
end

function SpreadTiles(x1, y1, x2, y2, src, des)
	for x=x1,x2 do
		for y=y1,y2 do
			if (RawTile(x, y) == des) then
				for dx=-1,1 do
					for dy=-1,1 do
						if (RawTile(x + dx, y + dy) == src) then
							SetRawTile(x, y, "Replace")
						end
					end
				end
			end
		end
	end
	ReplaceTiles(0, 0, CMap.Map.Info.MapWidth - 1, CMap.Map.Info.MapHeight - 1, "Replace", src)
end

function RotateArea(x, y, size, count)
	-- make rotation in range 0-3
	if (count > 3) then
		count = 3
	end
	
	-- bail out or recurse as needed
	if (count == 0) then
		return
	elseif (count > 1) then
		RotateArea(x, y, size, count - 1)
	end
	
	-- rotate tiles
	for p=0,(((size + 1) / 2) - 1) do
		for q=0,((size / 2) - 1) do
			local temp = RawTile(x + p, y + q)
			SetRawTile(x + p, y + q, RawTile(x + q, y + size - 1 - p))
			SetRawTile(x + q, y + size - 1 - p, RawTile(x + size - 1 - p, y + size - 1 - q))
			SetRawTile(x + size - 1 - p, y + size - 1 - q, RawTile(x + size - 1 - q, y + p))
			SetRawTile(x + size - 1 - q, y + p, temp)
		end
	end
	
	-- should rotate units as well
end

function ReplaceTiles(x1, y1, x2, y2, from, to)
	for x=x1,x2 do
		for y=y1,y2 do
			if (RawTile(x, y) == from) then
				SetRawTile(x, y, to)
			end
		end
	end
end

function CreateStartingGoldMine(player, x, y, no_raw_tile)
	local WhileCount = 0
	local gold_mine_built = false
	while (gold_mine_built == false and WhileCount < 100) do
		RandomNumber = SyncRand(4) -- which direction the gold mine will be created
		local gold_mine_spawn_point
		if (player == PlayerNumNeutral) then
			gold_mine_spawn_point = {x + SyncRand(14), y + SyncRand(14)}
		else
			if (RandomNumber == 0) then -- north
				gold_mine_spawn_point = {(CPlayer:GetPlayer(player).StartPos.x + (SyncRand(14) - 6)), (CPlayer:GetPlayer(player).StartPos.y - 6)}
			elseif (RandomNumber == 1) then -- south
				gold_mine_spawn_point = {(CPlayer:GetPlayer(player).StartPos.x + (SyncRand(14) - 6)), (CPlayer:GetPlayer(player).StartPos.y + 7)}
			elseif (RandomNumber == 2) then -- west
				gold_mine_spawn_point = {(CPlayer:GetPlayer(player).StartPos.x - 6), (CPlayer:GetPlayer(player).StartPos.y + (SyncRand(14) - 6))}
			elseif (RandomNumber == 3) then -- east
				gold_mine_spawn_point = {(CPlayer:GetPlayer(player).StartPos.x + 7), (CPlayer:GetPlayer(player).StartPos.y + (SyncRand(14) - 6))}
			end
		end
		local free_square = true
		for sub_x=-1,3 do
			for sub_y=-1,3 do
				if (no_raw_tile) then
					if (GetTileTerrainHasFlag(gold_mine_spawn_point[1] + sub_x, gold_mine_spawn_point[2] + sub_y, "unpassable") or GetTileTerrainHasFlag(gold_mine_spawn_point[1] + sub_x, gold_mine_spawn_point[2] + sub_y, "no-building") or GetTileTerrainHasFlag(gold_mine_spawn_point[1] + sub_x, gold_mine_spawn_point[2] + sub_y, "water")) then
						free_square = false
					end
				else
					if (RawTile(gold_mine_spawn_point[1] + sub_x, gold_mine_spawn_point[2] + sub_y) ~= "Land" and RawTile(gold_mine_spawn_point[1] + sub_x, gold_mine_spawn_point[2] + sub_y) ~= "Dark-Land") then
						free_square = false
					end
				end
			end
		end
		if ((gold_mine_spawn_point[1] + 2) > CMap.Map.Info.MapWidth or (gold_mine_spawn_point[2] + 2) > CMap.Map.Info.MapHeight or gold_mine_spawn_point[1] < 0 or gold_mine_spawn_point[2] < 0) then
			free_square = false
		end
		if (free_square) then
			if (no_raw_tile) then
				unit = CreateUnit("unit-copper-deposit", PlayerNumNeutral, {gold_mine_spawn_point[1], gold_mine_spawn_point[2]})
				SetResourcesHeld(unit, 50000)
				for i = 1, 9 do
					unit = CreateUnit("unit-copper-rock", PlayerNumNeutral, {gold_mine_spawn_point[1] + 1, gold_mine_spawn_point[2] + 1})
				end
			else
				for sub_x=-2,4 do
					for sub_y=-2,4 do
						SetRawTile(gold_mine_spawn_point[1] + sub_x, gold_mine_spawn_point[2] + sub_y, "Road") -- add "road" so that there are no transition issues
					end
				end
				for sub_x=0,(GetUnitTypeData("unit-copper-deposit", "TileWidth") - 1) do
					for sub_y=0,(GetUnitTypeData("unit-copper-deposit", "TileHeight") - 1) do
						SetRawTile(gold_mine_spawn_point[1] + sub_x, gold_mine_spawn_point[2] + sub_y, "Starting Gold Mine")
					end
				end
			end
			gold_mine_built = true
		end
		WhileCount = WhileCount + 1
	end
end

function CreateStartingBuilding(player, building_type)
	local width
	local height
	if (building_type == "Farm" or building_type == "Watch Tower" or building_type == "Guard Tower" or building_type == "Stronghold Guard Tower") then
		width = 2
		height = 2
	elseif (building_type == "Barracks" or building_type == "Lumber Mill" or building_type == "Smithy" or building_type == "Stables" or building_type == "Temple") then
		width = 3
		height = 3
	end
	local building_built = false
	local WhileCount = 0
	while (building_built == false and WhileCount < 10000) do
		local road_tile
		local road_found = false
		local SecondWhileCount = 0
		while (road_found == false and SecondWhileCount < 10000) do
			road_tile = {(CPlayer:GetPlayer(player).StartPos.x + (SyncRand(32) - 16)), (CPlayer:GetPlayer(player).StartPos.y + (SyncRand(32) - 16))}
			if (RawTile(road_tile[1], road_tile[2]) == "Road") then
				road_found = true
			end
			SecondWhileCount = SecondWhileCount + 1
		end
		RandomNumber = SyncRand(4) -- which direction the building will be created
		local building_spawn_point
		if (RandomNumber == 0) then -- north
			building_spawn_point = {(road_tile[1] - SyncRand(width)), (road_tile[2] - height)}
		elseif (RandomNumber == 1) then -- south
			building_spawn_point = {(road_tile[1] - SyncRand(width)), (road_tile[2] + 1)}
		elseif (RandomNumber == 2) then -- west
			building_spawn_point = {(road_tile[1] - width), (road_tile[2] - SyncRand(height))}
		elseif (RandomNumber == 3) then -- east
			building_spawn_point = {(road_tile[1] + 1), (road_tile[2] - SyncRand(height))}
		end
		local free_square = true
		for sub_x=-1,width+1 do
			for sub_y=-1,height+1 do
					if (RawTile(building_spawn_point[1] + sub_x, building_spawn_point[2] + sub_y) ~= "Land" and RawTile(building_spawn_point[1] + sub_x, building_spawn_point[2] + sub_y) ~= "Rough" and RawTile(building_spawn_point[1] + sub_x, building_spawn_point[2] + sub_y) ~= "Dark-Land" and RawTile(building_spawn_point[1] + sub_x, building_spawn_point[2] + sub_y) ~= "Dark-Rough" and RawTile(building_spawn_point[1] + sub_x, building_spawn_point[2] + sub_y) ~= "Road") then
						free_square = false
					end
					if (building_spawn_point[1] + sub_x < 0 or building_spawn_point[1] + sub_x >= CMap.Map.Info.MapWidth or building_spawn_point[2] + sub_y < 0 or building_spawn_point[2] + sub_y >= CMap.Map.Info.MapHeight) then
						free_square = false
					end
			end
		end
		if (free_square) then
			for sub_x=-1,width do
				for sub_y=-1,height do
					SetRawTile(building_spawn_point[1] + sub_x, building_spawn_point[2] + sub_y, "Road")
				end
			end
			for sub_x=1,width do
				for sub_y=1,height do
					SetRawTile(building_spawn_point[1] + sub_x - 1, building_spawn_point[2] + sub_y - 1, building_type .. " " .. player)
				end
			end
			building_built = true
		end
		WhileCount = WhileCount + 1
	end
end

function GenerateValley(direction, lake_quantity)
	CleanRawTiles()
	
	if (direction == nil) then
		if (SyncRand(2) == 0) then
			direction = "north-south"
		else
			direction = "west-east"
		end
	end

	if (lake_quantity == "random") then
		lake_quantity = SyncRand(4) -- 0-3 lakes
	end

	FillArea(0, 0, (CMap.Map.Info.MapWidth - 1), (CMap.Map.Info.MapHeight - 1), "Land", false)
	
	if (direction == "north-south") then
		CreatePlayers(round(CMap.Map.Info.MapWidth / 6), round(CMap.Map.Info.MapWidth * 5 / 6), 0, CMap.Map.Info.MapHeight, true, false, true, nil, nil, false)
		
		GenerateRocks(((CMap.Map.Info.MapWidth / 6 * CMap.Map.Info.MapHeight) / 32), ((CMap.Map.Info.MapWidth / 6 * CMap.Map.Info.MapHeight) / 4), "Land", 0, round(CMap.Map.Info.MapWidth / 6), 0, CMap.Map.Info.MapHeight)
		
