		GenerateRocks(((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight / 6) / 32), ((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight / 6) / 4), "Land", 0, CMap.Map.Info.MapWidth, 0, round(CMap.Map.Info.MapHeight / 6))
		
