function GenerateCave(town_halls, symmetric)
	local RandomNumber = 0
	local RandomX = 0
	local RandomY = 0
	local Count = 0
	local EntranceExists = false

	for x=0,(CMap.Map.Info.MapWidth - 1) do
		for y=0,(CMap.Map.Info.MapHeight - 1) do
			SetRawTile(x, y, "Land")
		end
	end

	SetMapBorders("Rock", true)

	CreatePlayers(16, CMap.Map.Info.MapWidth - 16, 16, CMap.Map.Info.MapHeight - 16, town_halls, symmetric, true, nil, nil, false)

	GenerateRocks(((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024),  ((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 4), "Land", 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)

	GenerateWater((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 64, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)

	GenerateRoughLand((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 4096, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 32)

	GenerateTrees((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 1024, (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 32, 0, CMap.Map.Info.MapWidth, 0, CMap.Map.Info.MapHeight)

	if (symmetric) then
		for x=(CMap.Map.Info.MapWidth / 2),(CMap.Map.Info.MapWidth - 1) do
			for y=0,(CMap.Map.Info.MapHeight - 1) do
				local mirrored_tile_x = x + 1 - 128
				if (mirrored_tile_x < 0) then
					mirrored_tile_x = mirrored_tile_x * -1
				end
				if (string.find(RawTile(x, y), "Town Hall") == nil and string.find(RawTile(mirrored_tile_x, y), "Town Hall") == nil) then
					SetRawTile(x, y, RawTile(mirrored_tile_x, y))
				end
			end
		end

		for x=0,(CMap.Map.Info.MapWidth - 1) do
			for y=(CMap.Map.Info.MapHeight / 2),(CMap.Map.Info.MapHeight - 1) do
				local mirrored_tile_y = y + 1 - 128
				if (mirrored_tile_y < 0) then
					mirrored_tile_y = mirrored_tile_y * -1
				end
				if (string.find(RawTile(x, y), "Town Hall") == nil and string.find(RawTile(x, mirrored_tile_y), "Town Hall") == nil) then
					SetRawTile(x, y, RawTile(x, mirrored_tile_y))
				end
			end
		end
	end
	
	AdjustTransitions(0, CMap.Map.Info.MapWidth - 1, 0, CMap.Map.Info.MapHeight - 1)

	ApplyRawTiles()

	CreateGoldSpots((CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 2048, 0, CMap.Map.Info.MapWidth - 3, 0, CMap.Map.Info.MapHeight - 3, symmetric)

	CreateCritters()

	if (GetCurrentTileset() == "cave") then
		CreateNeutralBuildings("unit-hole", (CMap.Map.Info.MapWidth * CMap.Map.Info.MapHeight) / 4096, 0, CMap.Map.Info.MapWidth - 2, 0, CMap.Map.Info.MapHeight - 2, symmetric)
	end

	
	CreateNeutralBuildings("unit-mercenary-camp", 1, 0, CMap.Map.Info.MapWidth - 3, 0, CMap.Map.Info.MapHeight - 3, symmetric)

	for i=0,(PlayerMax - 2) do
		if (CMap.Map.Info.PlayerType[i] == PlayerPerson or CMap.Map.Info.PlayerType[i] == PlayerComputer) then
			for j=1,5 do
				unit = CreateUnit("unit-germanic-worker", i, {CPlayer:GetPlayer(i).StartPos.x, CPlayer:GetPlayer(i).StartPos.y})
			end
		end
	end
end

function SpawnUnitBlock(player, unit, x, y, width, height)
    for loopx = 0, width-1 do
        for loopy = 0, height-1 do
            CreateUnit(unit, player, {(x+loopx), (y+loopy)})
        end
    end
end

function FindNearestTerrainTile(terrain, starting_x, starting_y)
	local search_range = 0
	
	while (search_range < CMap.Map.Info.MapWidth and search_range < CMap.Map.Info.MapHeight) do
		for x=(starting_x - search_range), (starting_x + search_range) do
			for y=(starting_y - search_range), (starting_y + search_range) do
				if (GetTileTerrainName(x, y) == terrain) then
					return {x, y}
				end
			end
		end
		search_range = search_range + 1
	end
	
	return nil
end

function FindNearestTerrainFlagTile(terrain_flag, starting_x, starting_y)
	local search_range = 0
	
	while (search_range < CMap.Map.Info.MapWidth and search_range < CMap.Map.Info.MapHeight) do
		for x=(starting_x - search_range), (starting_x + search_range) do
			for y=(starting_y - search_range), (starting_y + search_range) do
				if (GetTileTerrainHasFlag(x, y, terrain_flag)) then
					return {x, y}
				end
			end
		end
		search_range = search_range + 1
	end
	
	return nil
end

function GenerateBuilding(building_type, player)
	local worker = FindUnitOfClass("worker", player)
	
	if (worker == nil) then
		return;
	end
	
	unit = CreateBuildingAtRandomLocationNear(building_type, player, {GetUnitVariable(worker,"PosX"), GetUnitVariable(worker,"PosY")}, worker)
end

function GetTerrainCivilizations(terrain)
	local terrain_civilizations = {}
	if (terrain == "dry-mud" or terrain == "cave-floor") then
		table.insert(terrain_civilizations, "dwarf")
		table.insert(terrain_civilizations, "gnome")
		table.insert(terrain_civilizations, "goblin")
		table.insert(terrain_civilizations, "kobold")
		table.insert(terrain_civilizations, "ettin")
	end
	if (terrain == "dirt" or terrain == "grass" or terrain == "snow") then
		table.insert(terrain_civilizations, "anglo-saxon")
		table.insert(terrain_civilizations, "english")
		table.insert(terrain_civilizations, "frankish")
		table.insert(terrain_civilizations, "germanic")
		table.insert(terrain_civilizations, "goth")
		table.insert(terrain_civilizations, "norse")
		table.insert(terrain_civilizations, "suebi")
		table.insert(terrain_civilizations, "teuton")
	end
	if (terrain == "dirt" or terrain == "grass") then
		table.insert(terrain_civilizations, "latin")
	end

	return terrain_civilizations
end

function CreatePlayerForFaction(faction, init_ai)
	local faction_player = FindUnusedPlayerSlot()
	if (faction_player ~= -1) then
		CPlayer:GetPlayer(faction_player).Type = PlayerComputer				
		SetPlayerData(faction_player, "RaceName", GetFactionData(faction, "Civilization"))
		SetPlayerData(faction_player, "Faction", faction)
		if (init_ai) then
			SetPlayerData(faction_player, "AiEnabled", true)
			SetAiType(faction_player, GetFactionData(faction, "DefaultAI"))
			SetPlayerData(faction_player, "Team", 1)
			SetPlayerData(faction_player, "Resources", "copper", 2500)
			SetPlayerData(faction_player, "Resources", "lumber", 2500)
			SetPlayerData(faction_player, "Resources", "stone", 2500)
			InitAi(faction_player)
		end
	end
	return faction_player
end